(41, 'cookie.data', '{\"short_desc\":\"We may use cookies or any other tracking technologies when you visit our website, including any other media form, mobile website, or mobile application related or connected to help customize the Site and improve your experience.\",\"description\":\"<div class=\\\"mb-5\\\" style=\\\"font-family: Nunito, sans-serif; margin-bottom: 3rem !important;\\\"><h3 class=\\\"mb-3\\\" style=\\\"font-weight: 600; line-height: 1.3; font-size: 24px; font-family: Exo, sans-serif;\\\"><font color=\\\"#ffffff\\\">What information do we collect?<\\/font><\\/h3><p class=\\\"font-18\\\" style=\\\"margin-right: 0px; margin-left: 0px; font-size: 18px !important;\\\"><font color=\\\"#ffffff\\\">We gather data from you when you register on our site, submit a request, buy any services, react to an overview, or round out a structure. At the point when requesting any assistance or enrolling on our site, as suitable, you might be approached to enter your: name, email address, or telephone number. You may, nonetheless, visit our site anonymously.<\\/font><\\/p><\\/div><div class=\\\"mb-5\\\" style=\\\"font-family: Nunito, sans-serif; margin-bottom: 3rem !important;\\\"><h3 class=\\\"mb-3\\\" style=\\\"font-weight: 600; line-height: 1.3; font-size: 24px; font-family: Exo, sans-serif;\\\"><font color=\\\"#ffffff\\\">How do we protect your information?<\\/font><\\/h3><p class=\\\"font-18\\\" style=\\\"margin-right: 0px; margin-left: 0px; font-size: 18px !important;\\\"><font color=\\\"#ffffff\\\">All provided delicate\\/credit data is sent through Stripe.<br>After an exchange, your private data (credit cards, social security numbers, financials, and so on) won\'t be put away on our workers.<\\/font><\\/p><\\/div><div class=\\\"mb-5\\\" style=\\\"font-family: Nunito, sans-serif; margin-bottom: 3rem !important;\\\"><h3 class=\\\"mb-3\\\" style=\\\"font-weight: 600; line-height: 1.3; font-size: 24px; font-family: Exo, sans-serif;\\\"><font color=\\\"#ffffff\\\">Do we disclose any information to outside parties?<\\/font><\\/h3><p class=\\\"font-18\\\" style=\\\"margin-right: 0px; margin-left: 0px; font-size: 18px !important;\\\"><font color=\\\"#ffffff\\\">We don\'t sell, exchange, or in any case move to outside gatherings by and by recognizable data. This does exclude confided in outsiders who help us in working our site, leading our business, or adjusting you, since those gatherings consent to keep this data private. We may likewise deliver your data when we accept discharge is suitable to follow the law, implement our site strategies, or ensure our own or others\' rights, property, or wellbeing.<\\/font><\\/p><\\/div><div class=\\\"mb-5\\\" style=\\\"font-family: Nunito, sans-serif; margin-bottom: 3rem !important;\\\"><h3 class=\\\"mb-3\\\" style=\\\"font-weight: 600; line-height: 1.3; font-size: 24px; font-family: Exo, sans-serif;\\\"><font color=\\\"#ffffff\\\">Children\'s Online Privacy Protection Act Compliance<\\/font><\\/h3><p class=\\\"font-18\\\" style=\\\"margin-right: 0px; margin-left: 0px; font-size: 18px !important;\\\"><font color=\\\"#ffffff\\\">We are consistent with the prerequisites of COPPA (Children\'s Online Privacy Protection Act), we don\'t gather any data from anybody under 13 years old. Our site, items, and administrations are completely coordinated to individuals who are in any event 13 years of age or more established.<\\/font><\\/p><\\/div><div class=\\\"mb-5\\\" style=\\\"font-family: Nunito, sans-serif; margin-bottom: 3rem !important;\\\"><h3 class=\\\"mb-3\\\" style=\\\"font-weight: 600; line-height: 1.3; font-size: 24px; font-family: Exo, sans-serif;\\\"><font color=\\\"#ffffff\\\">Changes to our Privacy Policy<\\/font><\\/h3><p class=\\\"font-18\\\" style=\\\"margin-right: 0px; margin-left: 0px; font-size: 18px !important;\\\"><font color=\\\"#ffffff\\\">If we decide to change our privacy policy, we will post those changes on this page.<\\/font><\\/p><\\/div><div class=\\\"mb-5\\\" style=\\\"font-family: Nunito, sans-serif; margin-bottom: 3rem !important;\\\"><h3 class=\\\"mb-3\\\" style=\\\"font-weight: 600; line-height: 1.3; font-size: 24px; font-family: Exo, sans-serif;\\\"><font color=\\\"#ffffff\\\">How long we retain your information?<\\/font><\\/h3><p class=\\\"font-18\\\" style=\\\"margin-right: 0px; margin-left: 0px; font-size: 18px !important;\\\"><font color=\\\"#ffffff\\\">At the point when you register for our site, we cycle and keep your information we have about you however long you don\'t erase the record or withdraw yourself (subject to laws and guidelines).<\\/font><\\/p><\\/div><div class=\\\"mb-5\\\" style=\\\"font-family: Nunito, sans-serif; margin-bottom: 3rem !important;\\\"><h3 class=\\\"mb-3\\\" style=\\\"font-weight: 600; line-height: 1.3; font-size: 24px; font-family: Exo, sans-serif;\\\"><font color=\\\"#ffffff\\\">What we don\\u2019t do with your data<\\/font><\\/h3><p class=\\\"font-18\\\" style=\\\"margin-right: 0px; margin-left: 0px; font-size: 18px !important;\\\"><font color=\\\"#ffffff\\\">We don\'t and will never share, unveil, sell, or in any case give your information to different organizations for the promoting of their items or administrations.<\\/font><\\/p><\\/div>\",\"status\":0}', 0, '2020-07-04 23:42:52', '2023-03-27 09:06:04'),
(42, 'policy_pages.element', '{\"title\":\"Privacy Policy\",\"details\":\"<p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">PRIVACY POLICY\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">1. PRIVACY\\nWe are committed to protecting your personal information. We have created this Privacy\\nPolicy to let you know what information We collect when you use Our services at Our\\nonline sites (collectively, the \'Service\'), why We collect this information and how We use\\nthe collected information.\\nPlease note that this Privacy Policy will be agreed between you and the kfc.bet as\\ndefined in the Terms and Conditions of Use (kfc.bet\\u2019,\\u2019 We\', \'Us\' or \'Our\', as appropriate).\\nWe may periodically make changes to this Privacy Policy and will notify you of these\\nchanges by posting the modified terms on Our online site. We recommend that you\\nrevisit this Privacy Policy regularly.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">2. INFORMATION COLLECTED\\nWe consider information that may be used to identify an individual, including, but not\\nlimited to, first and last name, date of birth, bank\\/payment details, home or other\\nphysical address, email address, phone number or other contact information to be\\nPersonal Information (\'Personal Information\'). You may be asked to provide Personal\\nInformation when you use Our website, register for an account or to use the Service.\\nThe Personal Information that We collect may include information such as: contact\\ninformation (including telephone number), shipping information, billing information,\\ntransaction history, website usage preferences, and feedback regarding the Service.\\nThis information is held by Us on servers based in Singapore and elsewhere from time\\nto time. In addition, when you interact with the Service, our servers keep an activity log\\nunique to you that collects certain administrative and traffic information including: source\\nIP address, time of access, date of access, web page(s) visited, language use, software\\ncrash reports and type of browser used. This information is essential for the provision\\nand quality of the Service. We do not collect Personal Information about you on the\\nService without your knowledge.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">3. MEANS OF COLLECTING AND PROCESSING DATA\\nWe may automatically collect certain data as discussed above and receive Personal\\nInformation about you where you provide such information through the Service or other\\ncommunications and interactions with Us. We may also receive Personal Information\\nfrom online vendors and service providers that refer you to the White Label Sites, and\\nfrom customer lists lawfully acquired from third-party vendors. In addition, we may\\nengage the services of third-party service providers to provide technical support,\\nprocess your online transactions and maintain your online account. We will have access\\nto any information you provide to such vendors, service providers and third-party\\ne-commerce services, and We will use the Personal Information as set out in this\\nPrivacy Policy below. This information will only be disclosed to third parties outside the\\nkfc.bet in accordance with this Privacy Policy. We take steps to ensure that Our\\narrangements with third-party service providers and online vendors protect your privacy.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">4. INFORMATION USE\\nWe use the Personal Information We collect from you to deliver Our Service, to provide\\ncustomer support, to undertake necessary security and identify verification checks, to\\nprocess any of your online transactions, meet certain business requirements and for\\nany other purpose related to the operation of the Service. Your Personal Information\\nmay also be used by Us to provide you with promotional offers and information\\nregarding kfc.bet products and services and in order for the kfc.bet to better provide a\\nrange of products and services and improved customer service. From time-to-time, we\\nmay request information from you via surveys or contests. Participation in these surveys\\nor contests is completely voluntary, and, therefore, you have the choice of whether or\\nnot to disclose such information. Information requested may include contact information\\n(such as name, correspondence address and telephone number), and demographic\\ninformation (such as zip or postal code or age). If you choose to participate in a survey\\nor contest and win, by accepting any contest prize or winnings from Us, you consent to\\nuse of your name and likeness for advertising and promotional purposes without\\nadditional compensation, except were prohibited by law. Unless you have elected not to\\nreceive promotional information, we may also use your Personal Information (including\\nyour email address and phone number) to provide you with information regarding our\\nproducts, services and promotions, including other gaming products (including online\\ncasino, live casino, bingo, poker, sportsbook and casual games services) and products\\nand services from third parties carefully selected by Us.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">5. CERTAIN EXCLUDED DISCLOSURES\\nWe may disclose your Personal Information if required to do so by law, or if We believe\\nin good faith that such action is necessary to: (1) comply with any legal process served\\non Us, any of Our sites or the Service or in circumstances where We are under a\\nsubstantially similar legal obligation; (2) protect and defend Our rights or property; or (3)\\nact to protect the personal safety of users of the Service or the public. If, in our sole\\ndetermination, you are found to have cheated or attempted to defraud Us, or any other\\nuser of the Service in any way including but not limited to game manipulation or\\npayment fraud, or if We suspect you of fraudulent payment, including use of stolen bank\\naccounts, or any other fraudulent activity (including any chargeback or other reversal of\\na payment) or prohibited transaction (including money laundering), We reserve the right\\nto share this information (together with your identity) with other online gaming sites,\\nbanks, credit card companies, and appropriate agencies.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">6. ACCESS\\nYou may \'opt out\' of receiving any promotional communications either by choosing to\\nopt out where such option is made available on Our sites or the Service or SMS you\\nreceive from Us, or at any time by chatting our 24\\/7 Chat Support directly in our kfc.bet\\nwebsite. In addition, you may contact Us via our 24\\/7 Chat Support and we can\\nschedule a video call if you: 1) want to confirm the accuracy of the Personal Information\\nWe have collected about you; 2) would like to update your Personal Information or\\ndelete your Personal Information; and\\/or 3) have any complaint regarding Our use of\\nyour Personal Information. If requested, we will change any information you have\\nprovided to Us or mark any information to prohibit future use, provided that you provide\\nevidence as We may reasonably require for such changes.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">7. CONSENT TO USE OF ELECTRONIC SERVICE PROVIDERS\\nIn order to play real money games on the Service, you will be required to send money to\\nand receive money from Us. We may use third-party electronic payment processors\\nand\\/or financial institutions (\'ESPs\' as e-Wallets and Online Banking) to process such\\nfinancial transactions. By accepting this Privacy Policy, you expressly consent to\\nPersonal Information necessary for the processing of transactions being shared with\\nESPs, including, where necessary, the transfer of information outside of your country.\\nWe take steps to ensure that Our arrangements with ESPs protect your privacy.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">8. CONSENT TO SECURITY REVIEW\\nWe reserve the right to conduct a security review at any time to validate your identity,\\nage, the registration data provided by you and to verify your use of the Service and your\\nfinancial transactions for potential breach of Our Terms and Conditions and of\\napplicable law. By accepting Our Terms and Conditions you authorize Us, Our staff,\\nagents and suppliers to use your Personal Information and to disclose your Personal\\nInformation to third parties for the purposes of validating the information you provide to\\nUs in the course of using the Services. Security reviews may include but are not limited\\nto ordering a bank or payment report and\\/or otherwise verifying the information you\\nprovide against third-party databases. In addition, to facilitate these security reviews,\\nyou agree to provide such information or documentation as We may request.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">9. CONSENT TO USE OF ANTI-CHEATING SOFTWARE\\nOur software package - used to access and use the Service - contains certain features\\ndesigned to detect use of automated programs that enable artificial (non-human)\\nintelligence to play on Our site. Use of such bot software programs violates Our Terms\\nand Conditions, where We deem it detrimental to other players. By installing Our\\nsoftware and using the Service, you consent to Our software performing the functions\\ndescribed in this section. Our software may perform any or all of the following functions\\nin order to detect the use of illicit automated programs and ensure that We maintain a\\n\'cheat free\' environment for all users: (1) scan your list of active software applications\\nwhile you are using the Service; (2) scan your list of active processes while you are\\nusing the service; and (3) scan the files in your White Label Service site-related\\nprogram folders to ensure that only \'non-hacked\' versions of Our software are being\\nused. If any of the foregoing processes reveals a suspect application or process, our\\nsoftware may scan the files associated with the suspect application or process and\\ncompile a composite mesh (i.e., a profile that characterizes the files associated with the\\napplication or process) to be matched against profiles for known illicit automated\\nprograms. Our software will not perform any random search of large portions of your\\nhard drive, equipment or files, and it will not transmit any information to Us or to any\\nthird party other than the information necessary to identify use of illicit automated\\nprograms as described above. Our software will not alter any files or information on your\\ncomputer or other equipment and will not interfere with the operation of any of your\\napplications. You may terminate use of Our software at any time by uninstalling the Our\\nsoftware package.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">10. SECURITY\\nWe understand the importance of information security and the techniques needed to\\nsecure information. We store all of the Personal Information We receive directly from\\nyou in a password-protected database residing within Our secure network behind active\\nstate-of-the-art firewall software. Our online sites and the Service support latest\\nSSL\\/TLS protocol. We take steps to ensure Our subsidiaries, agents, affiliates and\\nsuppliers also employ adequate levels of security.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">11. PROTECTION OF CHILDREN\\nThe Service is not intended for or directed at persons under the age of 21. Any person\\nwho provides their information to Us through any part of the Service represents to Us\\nthat they are 21 years of age or older. It is Our policy to uncover attempts by minors to\\naccess Our Services which may involve Us having to access and verify your Personal\\nInformation. This may involve Us having to access and verify your Personal Information.\\nIf We become aware that a minor has attempted to or has submitted personal\\ninformation via the online site, we will not accept this information and will take steps to\\nremove such information from Our records.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">12. LEGAL DISCLAIMER\\nThe Service operates \'AS-IS\' and \'AS-AVAILABLE,\' without liability of any kind. We are\\nnot responsible for events beyond Our direct control. Because of the complex and\\nconstantly changing nature of Our technology and business, we cannot guarantee nor\\ndo We represent that there will be error-free performance regarding the privacy of your\\nPersonal Information, and We will not be liable for any indirect, incidental, consequential\\nor punitive damages relating to the use or release of Personal Information.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">13. MERGERS AND OTHER EVENTS REQUIRING TRANSFER\\nIf we should ever file for bankruptcy, or become insolvent, or be acquired by a third\\nparty, merge with a third party, sell all or part of Our assets, or transfer substantially all\\nor part of Our relevant assets to a third party, we are entitled to share the Personal\\nInformation and all other information you have provided through the Service to potential\\nand subsequent business and merger partners.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">14. CONSENT TO PRIVACY POLICY\\nBy clicking \'I agree\' during the registration process or by your continued use of the\\nService following the posting of this Privacy Policy (as applicable), you agree to this\\nPrivacy Policy. This is Our entire and exclusive Privacy Policy and it supersedes any\\nearlier version. This Privacy Policy should be read in conjunction with Our Terms and\\nConditions and any additional applicable terms posted on Our online sites. We may\\nperiodically make changes to this Privacy Policy and will notify you of these changes by\\nposting the modified terms on Our online sites. We recommend that you revisit this\\nPrivacy Policy regularly.<br \\/><\\/p>\"}', 0, '2021-06-09 08:50:42', '2023-06-20 10:31:01'),
