s-serif;font-size:14px;\\\">3. FEES AND TAXES\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">3.1 You are fully responsible for paying all fees and taxes applied to Your winnings\\naccording to the laws of Curacao.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">4. GAME RULES\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">4.1 By accepting these Terms and Conditions, You confirm that You know and\\nunderstand the rules of the games offered on the Website. It is at Your discretion to\\nfamiliarise Yourself with the theoretical payout percentage of each game.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">5. USE OF PLAYER ACCOUNT\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">5.1 PLAYER RESPONSIBILITY\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">5.1.1 Player fully understands the provisions contained in this Agreement and is obliged\\nto comply with them.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">5.1.2 Player ensures that their age is 21 or older.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">5.1.3 Player acknowledges that their details in the personal account of the Casino are\\ncorrect.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">5.1.4 Player acknowledges that they have only one active member account with the\\nCasino.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">5.1.5 Player is obliged not to disclose the login details of a member account to third\\nparties and not to allow the third parties to gamble at the Casino through their member\\naccount.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">5.1.6 Players confirm that they are not:\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">(a) Public officials, which includes elective and appointive officials and employees,\\npermanent or temporary, whether in the career or non-career service, whether or not\\nthey receive compensation, regardless of amount;\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">(b) Persons under 21 years of age.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">(c) Curacao officials and employees\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">(d) Gaming site Operators and employees\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">(e) Unregistered players\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">(f) Banned individuals\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">(g) Spouse, common-law partner, children, parents of officials and persons mentioned in\\nitems (a), (b), and (d) above.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">5.1.7 Players acknowledge that they do not use the funds of third parties to replenish\\nthe Casino account. Usage of any joint bank accounts or joint credit\\/debit cards shared\\nby two or more individuals are not allowed in the aim to replenish the Casino account.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">5.2 REGISTRATION AND OPENING OF YOUR MEMBER ACCOUNT\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">5.2.1 Each player is allowed to create only one (1) personal account. Creating multiple\\nPlayer Accounts by a single player can lead, at the sole discretion of the Casino, to\\ntermination of all such accounts and cancellation of all payouts to the player. The player\\nshall not provide access to their Player Account or allow using the Website to any third\\nparty including but not limited to minors.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">5.2.2 Casino reserves the right to refuse to register a member account.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">6. INACTIVE ACCOUNTS\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">6.1 An inactive (dormant) account is a Player Account which a player has not logged\\ninto or logged out of for twelve (12) consecutive months.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">7. COMPLAINTS\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">7.1 You are free to contact our Customer Support team via LiveChat available 24\\/7 or\\nemail support@kfc.bet according to the instructions found on the Website to give us any\\ncomplaints regarding our services.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">7.2 If You have a problem, You have to describe it in detail as much as possible to\\nspeed up its resolution.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">7.3 In the event of a dispute, You agree that the results stored on the server are the final\\nproof and cannot be challenged.\\u00a0<\\/p><p style=\\\"margin-right:0px;margin-bottom:15px;margin-left:0px;padding:0px;text-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\"