ext-align:justify;font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;\\\">10.1 The player\'s account will automatically be debited upon submission of a cash out\\nrequest. It is the player\'s responsibility to claim his withdrawal for over-the-counter\\npayments or monitor that his withdrawal amount has been completely credited to his\\naccount for bank transfers or e-wallet cash outs.<br \\/><\\/p>\"}', 0, '2021-06-09 08:51:18', '2023-06-20 10:35:55'),
